import React from 'react';
import { Link } from 'react-router-dom';

function GroupCard({ imgUrl, time, groupName, admin, memberCount  }) {
  return (
    <div className="card">
      <div className="photo">
        <img src={imgUrl} alt="" className="img1" />
      </div>
      <h3>{groupName}</h3>
      <h4>Information:</h4>
      <p>Creation time: {time.split('T')[0]}<br />
        Admin: {admin}<br />
        Number of people: {memberCount }<br />
      </p>
      <Link to="/Members">Check members</Link>
    </div>
  );
}

export default GroupCard;
